import React from 'react';
import { Link } from 'react-router-dom';
import './NavBar.css';

const NavBar = () => {
  return (
    <div className="navbar">
      <strong><Link to="/about" className="nav-item">About</Link></strong>
      <strong><Link to="/ak" className="nav-item"><h1>AK</h1></Link></strong>
      <strong><Link to="/Projects" className="nav-item">Projects</Link></strong>
    </div>
  );
};

export default NavBar;
